ou might see these crisp white adidas NMD Human Race Blank Canvas and be tempted to start rescheduling your BBQ dinner plans, but then you’d be missing the point. Created to honor the Hindu celebration of Holi, also known as the festival of colors, the “Blank Canvas” name is intentional, as these were specifically designed by Pharrell and adidas to be covered in the festival’s colorful powders. As a bonus, they were also built to be insanely comfortable. Featuring an all white Primeknit upper, white lining, white laces, and its signature Boost midsole, this pair continued to build on the momentum of Pharrell’s now insanely popular silhouette. \r\n\r\nColorway\r\nCREAM WHITE/RUNNING WHITE/RUNNING WHITE\r\n\r\n Release Date\r\n02/23/2018',0,'AC7031','2022-04-01 10:00:11','2022-04-12 13:11:29',NULL,'',0,'','Adidas',NULL,NULL,2904,34002,41001,41001,42001,0.00,0,5,0,0,1,NULL,2,'2022-05-26 09:26:03',385.00,81003,NULL,NULL,NULL,0,1,82001,89005,'We are unable to offer returns, exchanges or swaps - including if you ordered the wrong size. The good news is you can always resell with us if you no longer want your item.',7.25,0,0,NULL,NULL),(881,3386,'Nike Blazer Mid 77 Vintage',21,1001,175.00,0.00,'00000000881','image_11111112710.png','The Nike Blazer is a monument in the history of Nike Basketball. The design was first popularized by NBA great George \"The Iceman\" Gervin in the 1970s and is now a classic lifestyle sneaker.\r\n\r\nThe Nike Blazer Mid 77 Vintage White Black features a smooth white leather upper with grey suede mudguards and black Swooshes. A white sole and classic Nike branded woven tongue label complete the design.\r\n\r\nColorway\r\nBLACK/SAIL-WHITE',0,' BQ6806-100','2022-04-01 10:00:22','2022-04-12 13:11:21',NULL,'',0,'','Nike',NULL,NULL,2904,34002,41001,41001,42001,0.00,0,5,0,0,0,NULL,0,NULL,14.00,81004,NULL,NULL,NULL,0,1,82001,89005,'We are unable to offer returns, exchanges or swaps - including if you ordered the wrong size. The good news is you can alwa